function List() {
    const reviewer = ['reviewer1', 'reviewer2']
    const review = ['This is good', 'This is very good']
    const reviews = review.map((r, index) => <li key = {index}>{r}</li>);
    return (<div>
        <dl>
            <dt>{reviewers}</dt>
            <dd>{reviews}</dd>
        </dl>
    </div>);
}
export default List;
